using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace LeetCode.Test
{
    [TestClass]
    public class _1429_FirstUniqueNumber_Test
    {
        [TestMethod]
        public void FirstUnique_1()
        {
            var solution = new _1429_FirstUniqueNumber(new int[] { 2, 3, 5 });
            var result = solution.ShowFirstUnique();
            Assert.AreEqual(2, result);

            solution.Add(5);
            result = solution.ShowFirstUnique();
            Assert.AreEqual(2, result);

            solution.Add(2);
            result = solution.ShowFirstUnique();
            Assert.AreEqual(3, result);

            solution.Add(3);
            result = solution.ShowFirstUnique();
            Assert.AreEqual(-1, result);
        }

        [TestMethod]
        public void FirstUnique_2()
        {
            var solution = new _1429_FirstUniqueNumber(new int[] { 7, 7, 7, 7, 7, 7 });
            var result = solution.ShowFirstUnique();
            Assert.AreEqual(-1, result);

            solution.Add(7);
            result = solution.ShowFirstUnique();
            Assert.AreEqual(-1, result);

            solution.Add(3);
            result = solution.ShowFirstUnique();
            Assert.AreEqual(3, result);

            solution.Add(3);
            result = solution.ShowFirstUnique();
            Assert.AreEqual(-1, result);

            solution.Add(7);
            result = solution.ShowFirstUnique();
            Assert.AreEqual(-1, result);

            solution.Add(17);
            result = solution.ShowFirstUnique();
            Assert.AreEqual(17, result);
        }

        [TestMethod]
        public void FirstUnique_3()
        {
            var solution = new _1429_FirstUniqueNumber(new int[] { 809 });
            var result = solution.ShowFirstUnique();
            Assert.AreEqual(809, result);

            solution.Add(809);
            result = solution.ShowFirstUnique();
            Assert.AreEqual(-1, result);
        }
